const BoxRight = ({ forecast }) => {
    return (
        <div style={boxRightStyle}>
            {forecast.temp}
            {forecast.id}
            {forecast.description}
        </div>
    );
}

const boxRightStyle = {
    margin: 0,
    width: '100%',
    height: '15%',
    background: 'rgba(255, 255, 255, 0.8)',
    borderRadius: '25px',
    boxShadow: '5px 5px 10px 5px rgba(0,0,0,0.1)'
}

export default BoxRight
